1882	15-101612	16	\N	\N	1	T2a	Primary	spitzoid melanoma	\N	\N	\N	\N	\N	172.6	\N	from Swapna	A broad shave biopsy demonstrates a compound proliferation of enlarged fusiform and epithelioid melanocytes. The background epidermis is acanthotic and harbors these melanocytes distributed in pagetoid fashion, and scattered well-formed pink globules are present concurrently. In fibrotic inflamed dermis below this, maturing nests, cords, and fascicles of similar melanocytes are noted. These melanocytes mature to form small compact nests at the base of the proliferation.	Four outside slides, S-15-28819-B1. One corresponding block received 10/23/15.	IMPRESSION WAS INFLAMED SEBORRHEIC KERATOSIS VS. R/O SCC	\N	\N	\N	Your submitted immunoperoxidase stains demonstrate that the Ki-67 cell proliferation index is low and that expression of p16 is not detectable. To further assess the nature of this proliferation, we first repeated p16 immunohistochemistry and additionally completed NTRK-1 immunostaining. The repeat p16 stain was again negative, while the NTRK-1 immunostain demonstrated significant positivity, and thus underlying NTRK-1 gene fusion may be present. Given the histopathologic findings and the above immunostaining results, the differential diagnosis included a so-called 'atypical Spitz tumor' and spitzoid melanoma. To enable full characterization, we next completed array-based comparative genomic hybridization (aCGH) to screen for genomic copy number anomalies, as would be expected with melanoma. After microdissection of tumor followed by extraction of tumoral DNA from the tissue block, application of aCGH revealed gain in proximal chromosome 1p as well as loss in chromosomes 9 and 14q. The identification of multiple chromosomal copy number abnormalities indicates genomic instability, as is stereotypical of melanoma. In short, the molecular findings we have defined are incompatible with interpretation as a melanocytic nevus. Additionally, the loss of chromosome 9 that has 