3241	CGH12-146	14	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	238.2	\N	\N	There is an ulcerated compound proliferation of melanocytes accompanied by pseudocarcinomatous epithelial hyperplasia. Situated at, or just beneath the junctional zone are nests of large fusiform melanocytes with relatively monomorphous oval vesicular nuclei and abundant amphophilic cytoplasm. A very high mitotic rate is evident, with some microscopic fields that contain four or five mitotic figures. Maturation with descent, coupled by a diminution in the sizes of aggregations and in the number of mitotic figures is evident toward the base of the lesion.	Six outside slides, PC12-135434-HD:A1,A2 and one corresponding block (A2).	HEMANGIOMA	\N	\N	\N	The mitotic rate in the upper part of the lesion, and the Ki-67 proliferation rate are both remarkable. The differential diagnosis includes a so-called atypical Spitz tumor and a spitzoid melanoma. The findings exceed those seen in a conventional Spitz's nevus. Comparative genomic hybridization did not show chromosomal gains or losses. Based on these findings, I favor a atypical Spitz tumor, i.e. a lesion with very limited metastatic capability. I would obtain a complete excision, if this has not already been done. The literature on sentinel lymph node biopsy and atypical Spitz tumor suggests a very low rate of involvement beyond local lymph nodes, and casts doubt on the utility of this technique in this setting.	PREDOMINANTLY INTRADERMAL PROLIFERATION OF LARGE, SPITZOID MELANOCYTES	173701	\N	\N	L	12-35761	A	SYNAT248	2010-2017	IP1121579	AirTable blocks_with_IP_info.csv
