1954	16-83056	11	\N	\N	\N	None	None	None	\N	0	FFPE	\N	\N	238.2	\N	\N	There is an ulcerated, mostly intradermal proliferation of large, oval and fusiform melanocytes with abundant pale cytoplasm and large, vesicular nuclei. These cells are present in confluent fascicles and sheets, with scattered relatively deep mitotic figures and little maturation or dispersion with descent. There is retention of p16 staining.	Nine outside slides, S16-27822 (A1-A2), including three unstained slides (A2), and one corresponding block (A2).	LESION, HISTORY OF BLEEDING, TREATMENT FOR WART AND PRESUMED KELOID (INTRALESIONAL STEROID INJECTION); ATYPICAL SPITZ TUMOR VS. SPITZOID MELANOMA	\N	\N	Scraping	The differential diagnosis includes an atypical Spitz tumor and a spitzoid melanoma. It is unclear from the history if the ulceration is spontaneous, or due to treatment or trauma. Given the degree of nuclear pleomorphism and the sheet-like growth pattern, I proposed that molecular testing would be advantageous to see if chromosomal copy number changes, as seen in melanoma are present here. I had also proposed hTERT promoter mutation analysis, but my understanding is that insurance has denied coverage for this test. Following microdissection and DNA extraction, we performed comparative genomic hybridization. This shows losses involving chr. 9, 13 and 18q, and a possible loss of the peri-centromeric area on chr. 10p. Losses involving chromosomes 9 and 10 are common in melanoma. The loss involving chr. 9 was not accentuated in the area of 9p that contains CDKN2A, making it unlikely that there is a homozygous deletion. This correlates with the preservation of p16 staining by immunohistochemistry.  Given the ulceration, histopathologic findings and the results of comparative genomic hybridization, I would regard this as a relatively high risk atypical Spitz tumor, if not spitzoid melanoma. It would be advantageous to also have the results of hTERT promoter testing.	ATYPICAL SPITZ TUMOR, ULCERAT