1798	14-96361	37	\N	\N	\N	None	None	None	\N	0	FFPE	\N	\N	238.2	\N	\N	Sections show a segment of acral skin with a compound melanocytic proliferation.  There are large polygonal, ovoid, and spindled melanocytes in nests separated by clefts from the overlying hyperplastic epidermis, and similar cells are present in collections in the dermis.  Within the epidermis, some of the melanocytes are within the spinous layer. In the dermis, some of the melanocytes contain abundant eosinophilic cytoplasm, but the size of the melanocytes appears to diminish with descent. The melanocytes extend into the reticular dermis.	Ovoid excision measuring 1.0 x 1.0 x 0.2 cm, including a central 0.8 x 0.7 cm pink-brown area. With margins inked, the specimen is serially sectioned perpendicular to the long axis and entirely submitted with five sections. HD/KC	0.7 X 0.9 CM TWO-TONED PLAQUE W/ DARK EDGES, HISTORY OF RAPID GROWTH; ACRAL NEVUS, R/O ATYPIA / MELANOMA VS. DERMATOFIBROMA VS. OTHER	\N	\N	Scraping	ADDENDUM, November 16, 2014: The following note has been modified from that in the original report and later addenda, copies of which are on file as .pdfs in our computer system: The junctional component is unusual since melanocytes are arranged in a somewhat irregular array, since many of these melanocytes are large and contain abundant eosinophilic cytoplasm and since there are foci in which single melanocytes predominate over nests. There are clusters of similar melanocytes in the underlying dermis.  Due to these unusual features, I sought to further evaluate this specimen via immunoperoxidase staining. Staining for BAP-1 did not show loss of nuclear staining, as would point to a mutation in that gene (present in a specific subset of Spitz's nevi and other spitzoid lesions). By contrast, there was loss of p16 staining among a subset of the junctional and dermal melanocytes, which can correlate with one of the common genomic aberrations seen in melanocytic neoplasms, bi-allelic loss of chr. 9p, where the gene, CDKN2A that encodes p16 is located.  Given the features on the routinely stained hematoxylin and eosin section, in concert with the partial loss of p16, a definitive diagnosis could not be reached based on these data. Therefore, after receiving authorization to proceed with comparative genomic hybridization (CGH) testing, following microdissection and DNA extraction, we performed CGH to further evaluate this proliferation.  The testing revealed gains of chromosome 7q and 10p. Otherwise, no significant abnormalities were detected. Interestingly, there were no abnormalities of chromosome 9p and thus the loss of p16 staining probably is not significant. The chromosomal abnormalities detected by the CGH study can be seen in atypical Spitz tumors, which is the category into which I would classify this lesion. The CGH results do not support the diagnosis of melanoma, since, in melanoma, there are usually many chromosomal abnormalities detected. Given that this atypical Spitz tumor has been narrow excised, I think that the site could be clinically monitored or a narrow re-excision could be performed. Both Drs. Boris Bastian and Philip LeBoit have reviewed this case and agree with this assessment.	COMPOUND MELANOCYTIC PROLIFERATION, EXTENDING TO WITHIN 0.3 MILLIMETERS OF THE PERIPHERAL INKED MARGIN	672655	243	\N	\N	14-96361	\N	CGH14-348	Nevus Library	IP1446353	AirTable blocks_with_IP_info.csv
