1745	14-15427	34	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	from Swapna	Sections show a roughly oval mass of melanocytes within fibrofatty tissue. At the periphery of the mass are cords and strands of small, round cells with relatively scant pale cytoplasm and monomorphous oval nuclei containing small nucleoli. These cells are separated by thickened collagen bundles in some areas, with a few melanophages. The center of the lesion is more cellular. There are sheets of cells with inconspicuous pale cytoplasm and considerably larger, vesicular nuclei with moderately enlarged reddish nucleoli. Several mitotic figures are evident (but usually 1-2 per mm square). There are occasional multinucleated cells, as well as pseudovascular spaces within the masses of melanocytes. The enclosed immunostains include positive S100 and Melan-A stains, as well as an HMB-45 stain which marks both the smaller and larger melanocytes.	Twelve outside slides, SC14-637:A/1,A/2, XPS-14-931:B/1,B/2 (including five unstained slides cut from block A/1) and two corresponding blocks.	THIRD OPINION, NO HISTORY OF MELANOMA, PRESENT FOR YEARS AND HAD POSSIBLY BEEN INCREASING IN SIZE SLIGHTLY, INTRAOPERATIVELY IT SHELLED OUT EASILY AND DID NOT APPEAR TO BE CONNECTED OR INVOLVING THE OVERLYING EPIDERMIS; THROMBOSED VESSEL	\N	\N	\N	The HMB-45 staining of both components of the lesion is in keeping with both populations deriving from a blue nevus, probably a cellular blue nevus (the quotation marks reflect my unhappiness with the common/cellular dichotomy). The more cellular population lacks the typical nested, or lobular peninsula-like architecture of a cellular blue nevus, nuclei are somewhat enlarged and crowded, and the mitotic rate is higher than in most such lesions. However, the striking cytologic atypia, necrosis and lymphocytic infiltrate seen in some melanomas arising in blue nevi are not evident here. Some would term the current changes atypical blue nevus, a term I am not fond of but may have some applicability in this case. In keeping with this borderline character, comparative genomic hybridization shows an aberration not typically seen in melanoma. There is a gain involving chr. 9, which is often lost in melanoma. A re-excision of this area seems appropriate. In the reference below, the number of aberrations seen in blue nevus-like melanoma was higher than in atypical blue nevi or in conventional cellular blue nevi; with one aberration, and that one not typically associated with melanoma, this intermediate category seems best.  Reference:  Maize JC Jr, McCalmont TH, Carlson JA, Busam KJ, Kutzner H, Bastian BC. Genomic analysis of blue nevi and related dermal melanocytic proliferations. Am J Surg Pathol. 2005 Sep;29(9):1214-20.	ATYPICAL MELANOCYTIC PROLIFERATION ARISING IN A CELLULAR BLUE NEVUS	173788	648	\N	\N	14-15427	\N	DP-11	PRKC Fused Cases	IP1365348	AirTable blocks_with_IP_info.csv
1439	11-13665	36	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.5	\N	from Swapna	Sections show a polypoid segment of anal mucosa with a large, multinodular proliferation of neoplastic cells with amphophilic cytoplasm and large, pleomorphic vesicular nuclei. Foci of necrosis, many mitotic figures and clusters of melanophages are present. The enclosed immunoperoxidase stains show that the neoplastic cells are positive for HMB45 and Melan-A. Some areas feature enlarged single melanocytes colonizing the basal layer of the epithelium.	Seven outside slides, SROS11-255: A1,A2,A3. One corresponding block (A1) received 4/5/11.	UCSF MELANOMA CLINIC PATIENT	\N	\N	\N	ADDENDUM, April 29, 2011: The following note has been modified from that in the original report, a copy of which is on file as .pdfs in our computer system: The neoplasm extends to the edges of some of the sections, but whether these are true margins or not cannot be determined. There is a significant intraepithelial component, which led to my original supposition that this was a primary melanoma.  Given the findings on re-examination of a previous case in our files, 00-33973, we performed comparative genomic hybridization on both specimens. This specimen showed many genomic aberrations, including some commonly found in melanoma. These included a gain involving 1q, gains and losses in small areas on 5p, a loss on 5q, a gain of 6p and a loss of 6q, a loss of 8p and a gain of 8q, a gain near the end of 10q, a loss of 11q and a gain of 18p with a loss involving 18q. The quality of this hybridization was excellent, while the 2000 hybridization was not as good. However, there are clear aberrations in the 2000 hybridization shared by this one, including those involving 6p and 6q, and 8q. Also, there are clear inflections in the array of the 2000 case at most of the other sites that have aberrations in the current material. This strongly suggests that the current anal lesion is a metastasis from the 2000 cutaneous lesion and 