1618	12-24226	43	\N	\N	\N	T1a	Primary	None	\N	\N	\N	\N	\N	172.5	\N	from Swapna	Sections show a broad, asymmetrical, and badly circumscribed compound proliferation of enlarged epithelioid melanocytes. There are single melanocytes and nests distributed along the junction, and subtle areas of suprabasal scatter can be found. In the perijunctional dermis, some cross sections show non-maturing nests and cords of cytologically similar melanocytes. Other areas show a patchy perijunctional infiltrate of lymphocytes and melanophages. Very focally, the epidermal surface has overlying parakeratosis, suggesting trauma or irritation.	Three outside slides, D12-10741 and one corresponding block.	SHAVE BIOPSY IN TWO PIECES; R/O MELANOMA	\N	\N	\N	The differential diagnosis included a thin melanoma on one hand and an unconventional melanocytic nevus on the other, and the former possibility proves to represent the best interpretation for this atypical melanocytic proliferation. To fully substantiate the nature of this proliferation, we completed array-based comparative genomic hybridization (aCGH) to screen for genomic copy number anomalies. After extraction of tumoral DNA from the tissue block, application of aCGH revealed gain in chromosomes 4p, 5p, and 7p as well as loss in chromosomes 6p, 9p, and 12p. The identification of multiple chromosomal copy number aberrations suggests genomic instability, as is typical of malignancies such as melanoma. In summary, the combination of results derived from conventional microscopy coupled with aCGH points to a diagnosis of melanoma. With respect to staging, this melanoma is less than 1 mm in thickness, lacks associated ulceration, and does not have detectable melanocytes in mitosis in its invasive component. Therefore, it represents a melanoma of stage pT1a (2009 AJCC Guidelines). Further excision is warranted to ensure that local eradication has been accomplished.	MELANOMA OF 0.6 MM IN THICKNESS, EXTENDING INTRAEPIDERMALLY TO THE SPECIMEN PER