1867	15-52489	16	\N	\N	0	T1a	Primary	nevoid melanoma ex 'BAPoma'	\N	\N	\N	\N	\N	172.5	\N	\N	A broad shave biopsy contains a broad compound proliferation of melanocytes that is biphasic or triphasic in its composition. Within the epidermis, large fusiform and epithelioid melanocytes are distributed confluently, and the cells extend into the stratum spinosum, the stratum granulosum, and adnexal epithelium. In the dermis below this, a polymorphous melanocytic population is noted. There are large melanocytes in the upper dermis that are similar to those seen intraepidermally, while smaller hyperchromatic melanocytes are present more deeply in the dermis. Scattered only occasionally, there are also extremely large epithelioid melanocytes with ample cytoplasm. Much of the dermis appear fibrotic, and a scattered infiltrate of lymphocytes and eosinophils is also noted.	Four outside slides, 15-AD-26995-1A, and one corresponding block.	IMPRESSION WAS R/O R/O DYSPLASTIC NEVUS	\N	\N	\N	Array-based comparative genomic hybridization (aCGH) has been completed as per payor authorization. My previously-reported histopathologic analysis of this tumor remains in this report and is included in full below the line of asterisks that has been inserted (below). With respect to molecular assessment, after microdissection of tumor followed by extraction of tumoral DNA from the tissue block, application of aCGH revealed segmental loss of chromosome 3p as a monoaberration with no other associated chromosomal gains or losses. As background for understanding this result, note that many melanomas analyzed via aCGH demonstrate multiple associated chromosomal copy number gains or losses, while virtually all melanocytic nevi lack such aberrations. The identification of chromosome 3p loss confirms that BAP-1 genomic loss has occurred in this tumor. There are a number of reasons why aCGH analysis could fail to identify additional copy number change in a component of melanoma, including an inherent lack of copy number change in the given tumor, the effects of contaminating normal cells, or sampling error. In summary, the combination of results derived from conventional microscopy coupled with aCGH has confirmed the presence of BAP-1 genomic loss. Analysis by aCGH has not demonstrated a molecular footprint that is diagnostic of melanoma, but I still believe a component of melanoma is present on histopathologic grounds.  The technical methodology utilized in our aCGH analysis is described in the following reference: McCalmont TH, Vemula S, Sands P, Bastian BC. Molecular-microscopical correlation in dermatopathology. J Cutan Pathol. 2011; 38:323-5.  *************************************************************************************************************************** Objectively, I believe the histomorphology in your submitted slides point to a diagnosis of nevoid melanoma ex melanocytic nevus. Your submitted phosphohistone immunostain labels melanocytes in mitosis, most of which appear to be intraepidermal in distribution. We additionally completed p16 and BAP-1 immunostains as part of our assessment. The p16 stain demonstrates partial loss of expression, and thus hemizygous loss of chromosome 9p may be present in this tumor. The BAP-1 stain demonstrates loss of nuclear positivity in a subset of large epithelioid cells within this polymorphic tumor, and this labeling result indicates that BAP-1 genomic loss has occurred. In short, I believe this biopsy demonstrates melanoma ex 'BAPoma'.  Deletions (or loss) in BAP-1 can be detected by comparative genomic hybridization (CGH), and the presence of genomic loss can also be inferred by the identification of loss of nuclear BAP-1 expression by immunoperoxidase staining, as has been demonstrated here. Loss of BAP-1 can be accompanied by mutations in the remaining BAP-1 allele, which can be somatically acquired or inherited (germline). Inherited mutations of BAP-1 have recently been associated with a new cancer susceptibility syndrome, which is characterized by the occurrence of multiple skin-colored papules in affected individuals, only a minority of which develop uveal or cutaneous melanoma. Affected family members have had many (5 to >50) of the clinically innocuous yet histopathologically distinct melanocytic tumors, whereas there were few melanomas, suggesting that malignant potential is very low. Independently, germline mutations of BAP-1 have also been reported to be associated with familial mesothelioma.  The significance of this tumor in this patient needs to be judged in the larger familial context. If this is a solitary papule in a patient with no other similar lesions, then the BAP-1 alteration may be sporadic. If this patient has multiple similar papules or if there are similar papules in other family members, then the possibility of an underlying syndrome (with germline mutation) may be deserving of further consideration. If there is clinical interest in further corroborating the above diagnosis by means of comparative genomic hybridization (CGH), please let me know and we can proceed once authorization has been received.  Synoptic melanoma reporting is included below.  Procedure: shave removal Microscopic tumor type: nevoid melanoma ex 'BAPoma' Breslow thickness: 0.65 mm Ulceration: not detected Margin: deep edge involved Mitotic index: 0 Regression: not detected Pathologic staging (pTNM): pT1aNxMx	POLYMORPHOUS COMPOUND PROLIFERATION OF MELANOCYTES, INCLUDING BOTH MELANOMA OF 0.65 MM IN THICKNESS AND AN ATYPICAL COMBINED MELANOCYTIC NEVUS WITH ASSOCIATED BAP-1 GENOMIC LOSS	173568	680	\N	\N	15-52489	\N	DP-43	CGH Validation	IP1523838	AirTable blocks_with_IP_info.csv
