1871	15-71393	7	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.7	\N	\N	There is a compound proliferation of melanocytes with a domed surface, epidermal hyperplasia, a few moderately sized nests at the dermo-epidermal junction and nests, cords and strands in a peri-adnexal pattern in the dermis. The superficial melanocytes have moderately large amounts of cytoplasm and enlarged nuclei, with small, round melanocytes predominating toward the base of the lesion.	Eight outside slides, P15-16595-A1, including five unstained slides. One corresponding block received 8/5/15.	NEW FIRM HYPERPIG NODULE; R/O ATYPIA	\N	\N	\N	The features seemed in part to be a mixture of those of a Spitz's nevus and those of a superficial congenital nevus, but some raised the possibility of a nevoid melanoma, necessitating additional studies. As some Spitz's nevi with cells that have less cytoplasm than usual have NTRK1 gene fusions, I obtained that immunostain, but the strong staining seen in that situation is not present. A p16 immunostain shows that this tumor suppressor protein is retained only in a minority of cells, but these are distributed evenly, and not in a pattern suggesting loss of p16 in a clonal population, as could reflect bi-allelic loss of CDKN2A as would favor melanoma. A phosphohistone H3/Melan-A two color immunoperoxidase stain (this stain labels melanocytes in mitosis, or very close to mitosis in the cell cycle) has now been repeated (the first try resulted in a slide in which much of the tissue had fallen off), and shows a marginal mitosis as well as one in the mid-portion of the lesion.  Marginal mitoses are mentioned in the reference below as a finding favoring melanoma over Spitz's nevus, and also emerged in the results of an expert panel in 2008 evaluating melanocytic neoplasms of unknown malignant potential.  Given this finding, I suggested comparative genomic hybridization, which has now been completed. It shows multiple chromosomal gains and losses, indicating a level of