otropism is extreme and unusual. To clarify the diagnosis, we additionally completed array-based comparative genomic hybridization (aCGH) to screen for chromosomal copy number gain or loss, as per your authorization. After microdissection of tumor followed by extraction of tumoral DNA from the tissue block, application of aCGH revealed loss in chromosome 1p, focal loss in telomeric chromosome 2q, and gain in telomeric chromosome 7q, including the region where BRAF is encoded. This unusual molecular result with multiple small aberrations does not provide support to interpretation as frank melanoma but also indicates that this proliferation does not represent any form of conventional melanocytic nevus. In short, these combined histopathologic and molecular results suggest a partially transformed tumor; the findings we have defined are roughly equivalent to what is often termed 'atypical Spitz tumor'. My colleague, Dr. Iwei Yeh, also reviewed the molecular results for this case and is in agreement that the defined findings do not support interpretation as melanoma.  The neurotropic component of this unusual tumor extends focally to the inked specimen margin. Reexcision to obtain a free margin is recommended.  The technical methodology utilized in our aCGH analysis is described in the following reference: McCalmont TH, Vemula S, Sands P, Bastian BC. Molecular-microscopical correlation in dermatopathology. J Cutan Pathol. 2011; 38:323-5.	ATYPICAL COMBINED DEEP PENETRATING NEVUS-LIKE MELANOCYTIC PROLIFERATION WITH ASSOCIATED NEUROTROPISM	173526	732	\N	\N	17-48219	\N	DP-95	CGH Validation	IP1777827	AirTable blocks_with_IP_info.csv
