1616	12-24027C	13	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	238.2	\N	\N	Sections show a large segment of skin in which there is a superficial scar. In addition, there is an intradermal proliferation of large melanocytes arranged as nodular aggregations of varying sizes. Many of the lesional melanocytes contain abundant eosinophilic cytoplasm and some have eccentrically located nuclei. In addition, many of the lesional melanocytes contain prominent nucleoli. The size of the melanocytes generally does not diminish with descent into the dermis. Lesional melanocytes aggregate around nerves in the deep aspect of the specimen. Mitotic figures are present within the proliferation.	Oriented ellipse measuring 1.8 x 1.3 x 0.9 cm, including a central 1.2 x 1.2 cm pearly pink and raised area.  The orienting short suture is designated superior by the surgeon and arbitrarily designated 12:00 by the grosser. The orienting long suture is designated lateral by the surgeon and arbitrarily designated 3:00 by the grosser. The 12:00-3:00 margin is inked blue, the 3:00-6:00 margin is inked red, and the the 6:00-12:00 margin is inked yellow. The specimen is serially sectioned perpendicular to the long axis from 12:00 to 6:00 tips and entirely submitted with two sections each in cassettes C1 and C2 and one section each in cassettes C3 through C7.	A-C) LESION	\N	\N	\N	The findings in this current specimen were similar to those in the prior biopsy from this site (12-18611). Thus, the differential diagnosis was between a spitzoid melanoma and an unusual Spitz's nevus. To further evaluate for this differential diagnosis, we performed comparative genomic hybridization (CGH) on this tissue. The CGH data shows a small abnormality on the proximal portion of chromosome 5p, but it is very subtle and of uncertain significance. Therefore, our interpretation of the CGH data is that it does not show any meaningful chromosomal gains or losses.  Despite the normal CGH, given that numerous mitotic figures are present among lesional melanocytes, that many of the melanocytes have large, hyperchromatic nuclei, and the melanocytes are arranged as sheets, we are still quite concerned that the findings in this biopsy represent those of a spitzoid melanoma. If a melanoma has chromosomal aberrations that are copy number neutral, CGH will not show any aberrations, which could explain the normal CGH data in this case. If this lesion does represent a melanoma, it is 8.5 millimeters in thickness. However, as you know, spitzoid melanomas in children tend to behave in a less aggressive fashion compared with conventional melanomas of equivalent thickness. Therefore, the thickness measurement mentioned above should be interpreted in this context.  The residual melanoma present in this specimen is located at least 6 millimeters from all of the inked margins.  My colleagues, Drs. Timothy McCalmont, Philip LeBoit and Boris Bastian have seen these sections and agree with this assessment.	SCAR AND RESIDUAL INTRADERMAL PROLIFERATION OF LARGE, SPITZOID MELANOCYTES, CONCERNING FOR SPITZOID MELANOMA	173304	1357	\N	\N	12-24027	C	SMP11	Spitz Melanoma	IP1104428	AirTable blocks_with_IP_info.csv
1727	13-105024A	11	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	173.9	\N	\N	There is a proliferation of large oval and fusiform melanocytes that are predominantly situated in the dermis, forming large confluent nests at the junction of an irregularly hyperplastic epidermis with a domed surface. There is marked nuclear pleomorphism, with many of the cells having scant cytoplasm, resulting in an appearance where nuclei appear to overlap. Many of these nuclei are vesicular, with large nucleoli. Maturation with descent is faulty. Large aggregates are present at the base of the lesion. There is a dense lymphocytic infiltrate underlying the lesion.	One hematoxylin and eosin-stained section prepared from outside blocks labeled 67397 (A-B).	NOT PROVIDED	\N	\N	\N	While the scanning microscopic appearance raises the possibility of a Spitz's nevus, the degree of confluence of junctional nests, the high nuclear to cytoplasmic ratio, the large nucleoli and the failure to mature uniformly with descent are all findings that favor a spitzoid melanoma over a Spitz's nevus. Additionally, while the lesion appears to have a flat base at scanning magnification, that base is provided by lymphocytes. When one looks at the contour of the melanocytic proliferation itself, it is quite uneven. A p16 immunostain performed in our laboratory shows a near absence of staining. This can correlate with bi-allelic loss of chr. 9p. or chr. 9, but is not as strong evidence for the genomic loss as would be fluorescence in situ hybridization or comparative genomic hybridization testing. Currently, I use the term Spitzoid melanoma, childhood type, for an emerging class of lesions that usually but not exclusively occur in children and teens, usually lack b-raf mutations (which are present in most melanomas in adults) and have a propensity to involve local lymph nodes. Systemic spread either occurs infrequently or it does so in a delayed fashion compared to adult melanoma. These are findings that would support conservative treatment. Most lesions of this type are deeper, but usually not much wider than their exophytic portions, and even when they are, are well circumscribed. While sentinel nodes are often positive, this positivity has much less predictive value for systemic spread than is the case with adult melanoma. Hence, the thickness of 2.1 mm would result in a prognosis that is much more grim than a lesion such as this one would ordinarily have. A narrow re-excision and clinical follow-up is preferable to more aggressive treatment.	SPITZOID MELANOMA, CHILDHOOD TYPE	666955	1358	\N	\N	13-105024	A	SMP12	Spitz Melanoma	IP1347042	AirTable blocks_with_IP_info.csv
