1414	10-86469	16	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	Sections show an ulcerated proliferation of large oval and fusiform melanocytes with a domed surface. The epidermis is irregularly hyperplastic in some areas, and relatively thinned in others. There are large, confluent nests of cells with abundant amphophilic cytoplasm and large, vesicular nuclei superficially, with smaller aggregations of somewhat smaller cells toward the base of the lesion. Scattered mitotic figures are present. The enclosed immunoperoxidase-stained sections show retention of p16 staining by most of the nuclei, and a relatively high proliferation rate.	Six outside slides, GHS-10-7835, D10-9413:A. One corresponding block received 1/26/2011.	EXCORIATED COMPOUND MELANOCYTIC PROLIFERATION	\N	Iwei, CGH Array run| NTRK3 Translocation case	\N	This proliferation shows conflicting criteria, including some attributes (large confluent nests, a high proliferation index, easily-identifiable dermal mitotic figures, a thinned epidermis, and focal ulceration) that raised the possibility of spitzoid melanoma as a potential consideration in the differential diagnosis. The differential diagnosis also includes a traumatized cellular Spitz nevus. We received the tissue block and utilized it to pursue array-based comparative genomic hybridization (aCGH). After extraction of tumoral DNA from the tissue block, aCGH analysis did not reveal any chromosomal gains or losses. As you probably know, genomic gains and losses can be identified in the vast majority of melanomas, including proliferations within the spectrum of so-called childhood-type spitzoid melanoma. In short, the lack of demonstrable genomic anomalies in this specimen does not provide direct support for a diagnosis of spitzoid melanoma. I recommend complete excision of this site in follow-up. If the resultant reexcision specimen does not contain any residuum, then I view a traumatized hypercellular Spitz nevus as the most likely diagnostic possibility. If a nodular residuum is found below the site of the present biopsy, then it should be reassessed jointly with this specimen.	ULCERATED COMPOUND PROLIFERATION OF ENLARGED SPITZOID MELANOCYTES, INVOLVING THE DEEP EDGE OF THE BIOPSY	173701	1467	\N	\N	10-86469	\N	SYNAT384	2010-2017	IP981048	AirTable blocks_with_IP_info.csv
