1437	11-12273	2	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.2	\N	\N	Sections show a cellular, exophytic, polypoid compound proliferation of melanocytes. Within the background epidermis, which is thin, there are single melanocytes and nests distributed erratically, and cells above the junction can be found. The dermis below this contains large and irregular nests of similar melanocytes that lack maturation with descent in the dermis. An increase in dermal vascularity is appreciable. Dermal melanocytes in mitosis are easily found.	Seven outside slides, S10-40898 A1 (DC11-357, DEE-12580) and one corresponding block.	LARGE PEARLY PAPULE ON L PINNA FOR 2-3 WEEKS; FAVOR PYOGENIC GRANULOMA	\N	Iwei, CGH Array run| ROS1 Translocation case	\N	Our differential diagnosis included childhood-type spitzoid melanoma on one hand and a peculiar cellular Spitz nevus on the other. To address this differential, we completed array-based comparative genomic hybridization (aCGH) analysis to screen for melanoma-associated genomic anomalies. After extraction of tumoral DNA from the tissue block, aCGH analysis demonstrated gain in chromosome 1q and loss of chromosome 6q. The identification of multiple chromosomal gains and losses is not known to occur in Spitz nevi and favors instead the above interpretation. The designation childhood-type spitzoid melanoma refers to an emerging entity that we believe is distinct from conventional adult melanoma. Such tumors typically lack BRAF mutations and were reported in the past literature under such flawed designations as malignant Spitz nevus. Experience to date suggests a small risk for extension to regional lymph nodes with a low risk for widespread dissemination.  This proliferation has not been adequately excised. Further excision is warranted to ensure that local eradication has been accomplished.	CHILDHOOD-TYPE SPITZOID MELANOMA OF 2.9 MM IN THICKNESS	102270	1468	\N	\N	11-12273	\N	DP-16	CGH Validation	IP1001710	AirTable blocks_with_IP_info.csv
1455	11-23710	9	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	172.3	\N	KF-09, AND DP-17 are the same patient	Sections show enlarged spindled and fusiform melanocytes arrayed in nests and fascicles in compound fashion. Large nests and fascicles are apparent at the junction in concert with acanthosis (and also central erosion), and many coalescing fascicles reside in the dermis and upper subcutis below that in concert with a lymphohistiocytic infiltrate. There is only partial maturation with descent. Dermal melanocytes in mitosis can be found, especially in the upper half of the proliferation.	Five outside slides, S11-11651 and one corresponding block.	PYOGENIC GRANULOMA	\N	Iwei, CGH Array run| ROS1 Translocation case	\N	As you note in your correspondence regarding this case, this proliferation does not represent a conventional Spitz nevus. The lesion is ulcerated, has a high overall cellularity and has a nodular component in the subcutis. Comparative genomic hybridization shows loss of chromosome 6q, an aberration that is common in melanoma. There is also a gain of a small area in the distal part of 5q. Given these findings, I believe that this is best assessed as a spitzoid melanoma of childhood. I use this term for an emerging class of lesions that usually lack b-raf mutations (which are present in most melanomas) and have a propensity to involve local lymph nodes. Systemic spread either occurs infrequently or it does so in a delayed fashion compared to adult melanoma.  While the thickness is approximately 4.5 mm., it would be a mistake to use prognostic data from adult melanoma cases in this setting. The prognosis is far better. As the lesion extends to a dermal margins, a narrow re-excision is reasonable. Lesions of this type are usually well circumscribed, and I have not seen regrowth when narrow but clear margins have been obtained. The role of sentinel lymph nodes is debatable, as sentinel lymph node involvement is common, but distant metastasis is rare.	SPITZOID MEL