1446	11-20375	2	\N	\N	\N	None	None	None	\N	\N	\N	\N	\N	238.2	\N	\N	Sections show a compound proliferation of melanocytes that assumes a domed profile. In some areas, the background epidermis is acanthotic, and in other areas the background epithelium is thinned. In areas where the epithelium is expanded, there are single melanocytes and nests distributed within the epidermis at all levels, and large and well-formed pink globules (Kamino bodies) can be found above dermal papillae. Below this, there are nests and cords of melanocytes that in some areas mature with descent. In areas where the epithelium is thin, a nodular array of non-maturing melanocytes is appreciable. These cells are slightly spindled and epithelioid in morphology and have amphophilic or finely melanized cytoplasm. Within these nodules, melanocytes in mitosis are relatively easily found. A juxtaposed sparse infiltrate of lymphocytes is apparent as well.	One outside slide, 11-051610, and one corresponding block.	7 X 5 MM RED PAPULE THAT HAD BEEN PRESENT FOR ONE YEAR AND OVER THE LAST 1-2 MONTHS HAD BECOME "MORE PAPULAR", SHE HAS AN ADJACENT CONGENITAL NEVUS, CLINICAL DDX WAS PYOGENIC GRANULOMA VS. MOLLUSCUM CONTAGIOSUM VS. JUVENILE XANTHOGRANULOMA, NO FAMILY HISTORY OF MELANOMA, NEGATIVE FISH STUDY, WE WOULD APPRECIATE YOUR EVALUATION FOR COMPARATIVE GENOMIC HYBRIDIZATION	\N	\N	\N	Based upon conventional microscopy, the dominant nodule within this specimen shows a configuration that is worrisome for childhood-type spitzoid melanoma. This nodular proliferation developed secondarily within a preexistent Spitz nevus. I also understand that an adjacent congenital melanocytic nevus was noted clinically. To further assess the nature of this proliferation, we pursued array-based comparative genomic hybridization (aCGH) to screen for melanoma-associated genomic anomalies. After extraction of tumoral DNA from the tissue block, completion of aCGH analysis demonstrated loss in chromosomal 1p with no other associated chromosomal gains or losses. We have observed anomalies involving chromosome 1 in other examples of spitzoid melanoma. In summary, my interpretation of the the combination of results derived from conventional microscopy coupled with aCGH analysis is that a nodule of childhood-type spitzoid melanoma has developed secondarily within a preexistent Spitz nevus. The nodular population of melanocytes within this specimen is 1.6 mm in thickness. Please note that the negative prior analysis via fluorescence in situ hybridization (FISH) is unsurprising, as FISH testing only evaluates loci on chromosomes 6 and 11. To state it differently, the chromosomal anomaly that we have detected could not be identified via FISH.  The designation childhood-type spitzoid melanoma refers to an emerging entity that we believe is distinct from conventional adult melanoma. Such tumors typically lack BRAF mutations and were reported in the past literature under such flawed designations as malignant Spitz nevus. Experience to date suggests a small risk for extension to regional lymph nodes with a low risk for widespread dissemination. The proliferation in this specimen involves the deep edge of the biopsy. Further excision is warranted to ensure that local eradication has been accomplished.	BIPHASIC COMPOUND PROLIFERATION OF ENLARGED SPITZOID MELANOCYTES, INCLUDING A NODULAR POPULATION OF ATYPICAL MELANOCYTES WITH CHROMOSOME 1p LOSS	101624	1548	\N	\N	11-20375	\N	SYNAT437	2010-2017	IP1009813	AirTable blocks_with_IP_info.csv
