10598	11-41004	8	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	216.3	Iwei 7Q Gain	CGH11-202 	Sections show a predominantly dermal proliferation of large melanocytes, with a domed surface and a wedge shaped base. The lesional melanocytes are fusiform, with abundant, pale amphophilic cytoplasm and large, pleomorphic vesicular and heterochromatic nuclei, some with large nucleoli. A few mitotic figures are present in melanocytes well within the dermis. While there is a greater degree of cellularity in the upper than in the lower part of the lesion, some of the aggregations toward the base of the lesion are substantial. The enclosed immunoperoxidase stains show that many nuclei are Ki-67 positive, but many of these may be those of lymphocytes.	Seven outside slides, SC11-2567.	\N	\N	\N	\N	The neoplasm extends to the peripheral dermal edge of the specimen. Many features favor a Spitz's nevus, but there are large aggregations deep in the lesion, a few mitotic figures at the level of the mid-reticular dermis and the melanocytic nuclei are more pleomorphic than usual. Complete excision, despite the cosmetically sensitive area is warranted.  Comparative genomic hybridization shows a gain involving chromosome 11p, and also one involving 7q. Isolated 11p gain usually corresponds to the formation of an isochromosome (two copies of 11p joined by a centromere), and has not been seen to date in melanoma. Spitz's nevi with this aberration are likely to have a mutation involving h-ras, and to deeply infiltrate the reticular dermis as single cells, findings that are present here. In this case, the 11p gain is not isolated but is associated by a gain of 7q. I consulted with Dr. Boris Bastian, at Sloan-Kettering Cancer Center, New York, a colleague whose laboratory developed diagnostic comparative genomic hybridization when he was here at UCSF. He has not seen these two aberrations together, and heretofore regarded them as mutually exclusive. He believes that the current CGH picture still favors Spitz's nevus, even though the 11p aberration is not an isolated one.  References:  van Engen-van Grunsven AC, van Dijk MC, Ruiter DJ, Klaasen A, Mooi WJ, Blokx WA. HRAS-mutated Spitz tumors: A subtype of Spitz tumors with distinct features. Am J Surg Pathol. 2010 Oct;34(10):1436-41.  Bastian BC, LeBoit PE, Pinkel D. Mutations and copy number increase of HRAS in Spitz nevi with distinctive histopathological features. Am J Pathol. 2000 Sep;157(3):967-72.	PREDOMINANTLY INTRADERMAL SPITZ'S NEVUS WITH SOME UNUSUAL FEATURES	102353	1820	\N	\N	11-41004	A	SYNX417	\N	IP1030443	Consolidated_data_final.csv
