ns or losses, while most melanocytic nevi lack such aberrations. We have identified gain in chromosome 7q as a monoaberration in a subset of unconventional Spitz nevi.  In summary, the combination of results derived from conventional microscopy coupled with aCGH has not produced support for a diagnosis of spitzoid melanoma. Rather, our analysis supports interpretation as an unconventional Spitz nevus. Given the complexity of this assessment, reexcision of this site would be reasonable to ensure local control and prevent persistence.  The technical methodology utilized in our aCGH analysis is described in the following reference: McCalmont TH, Vemula S, Sands P, Bastian BC. Molecular-microscopical correlation in dermatopathology. J Cutan Pathol. 2011; 38:323-5.	COMPOUND PROLIFERATION OF ENLARGED SPITZOID MELANOCYTES, CONSISTENT WITH THE SURFACE OF AN UNCONVENTIONAL COMPOUND SPITZ NEVUS	173304	1895	\N	\N	13-51657	A	SYNX492	\N	IP1293660	Consolidated_data_final.csv
