10794	13-94981	25	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	238.2	Iwei Translocation	CGH13-392 	There is a relatively narrowly based, and somewhat wedge-shaped compound proliferation of melanocytes that mostly involves the junctional zone and superficial dermis. There are nests of large oval cells at the junction, with some confluence of them. Some of these have homogeneous, and some vacuolated cytoplasm with dusty melanin. There are pleomorphic, vesicular nuclei with large nucleoli. Nuclear maturation and dispersion are both evident with descent. There are focally dense lymphocytic infiltrates. A mitotic figure is present in the mid-dermal portion of the lesion, either in a melanocyte or in a stromal cell. The enclosed Mart-1 stained sections highlight that the lesion has an irregular lower contour. A gradient of HMB-45 staining is present, mostly at the junction.	Five outside slides, M13-32431 1A (SU-13-25161 A).  One corresponding block received 11-26-13.	\N	\N	\N	\N	This spitzoid proliferation has marked confluence of both junctional nests and dermal ones, and in the thinner sections, some pulverocytes.* It also has an uneven lower border. These findings raised the possibility of a spitzoid melanoma. Comparative genomic hybridization shows chromosomal amplifications involving areas on 7p (near the terminal end) and 7q. The latter includes part of the b-raf gene. The fusion partner for b-raf in this case may be MAD1L1, a gene that has been seen as a fusion partner in other such cases. My colleague, Dr. Iwei Yeh also reveiwed the comparative genomic hybridization data and agrees with this interpretation of it.  Spitzoid lesions with b-raf fusions lack b-raf mutations (i.e. the sequence of the gene is wild type, but there is a break in the gene and the chromosome is attached at the breakpoint to its fusion partner). This mechanism can occur in Spitz's nevi, atypical Spitz tumors and in melanoma. An overview of the subject of braf fusions is in the paper from our group referenced below. The absence of other abberations in this lesion, with the exception of a low level loss involving chromosome 14q is against an outright diagnosis of spitzoid melanoma.  An atypical Spitz tumor may be the best category for this lesion. These are neoplasms that have feature more atypical than those of a conventional Spitz nevus, but not as worrisome as those of spitzoid melanoma. In aggregate data from over ten studies, local nodal involvment (usually very small deposits) is common, but extranodal metastasis is rare. This dissociation results in sentinel lymph node biopsy having very limited predictive value, and in my opinion, sometimes leading to over-treatment if small deposits lead to completion lymphadenectomy.  Reference:  Botton T, Yeh I, Nelson T, Vemula SS, Sparatta A, Garrido MC, Allegra M, Rocchi S, Bahadoran P, McCalmont TH, LeBoit PE, Burton EA, Bollag G, Ballotti R, Bastian BC. Recurrent BRAF kinase fusions in melanocytic tumors offer an opportunity for targeted therapy. Pigment Cell Melanoma Res. 2013 Nov;26(6):845-51. doi: 10.1111/pcmr.12148. Epub 2013 Aug 19. PubMed PMID: 23890088; PubMed Central PMCID: PMC3808507.   *This term is introduced in Massi G, LeBoit P. Histologic Diagnosis of Nevi and Melanoma, 2nd Edition, Springer-Verlag, Berlin Heidelberg, 2014 p. 57, and refers to cells with abundant, pale cytoplasm and dusty appearing melanin, deriving from the Latin term for dust	COMPOUND PROLIFERATION OF LARGE, ATYPICAL MELANOCYTES, BEST REGARDED AS AN ATYPICAL SPITZ TUMOR	173530	1931	\N	\N	13-94981	A	SYNX528	\N	IP1336996	Consolidated_data_final.csv
